import React from 'react';
import styled from "styled-components";

export const NavContainer = styled.div`
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  text-align: center;
  background-color: grey;
  position: fixed;
  bottom: 0;
  width: 100%;
  height: 10%;
`;

export const NavList = styled.div`

`;

export const NavSearch = styled.div`

`;

export const NavChat = styled.div`

`;

export const NavMyPage = styled.div`

`;


const Nav = () => {
  return (
    <NavContainer>

      <NavList>상품목록</NavList>
      <NavSearch>검색</NavSearch>
      <NavChat>채팅</NavChat>
      <NavMyPage>마이페이지</NavMyPage>

    </NavContainer>
  );
};

export default Nav;
